    readonly List<Expression> rules = new List<Expression>();
    readonly List<string[]> ruleWords = new List<string[]>();

    abstract class Expression
    {
        public abstract int Evaluate();
        public abstract override string ToString();
        public virtual bool NeedsParentheses { get { return true; } }
    }

    class Constant : Expression
    {
        public readonly int Value;
        public Constant(int value) { Value = value; }

        public override int Evaluate() { return Value; }
        public override string ToString() { return Value.ToString(); }
        public override bool NeedsParentheses { get { return false; } }

        public static readonly int[] _values = Enumerable.Range(1, 20).Where(i => i % 5 != 0).ToArray();
        public static Expression GetRandom(MonoRandom rnd)
        {
            return new Constant(_values[rnd.Next(0, _values.Length)]);
        }
    }

    class Variable : Expression
    {
        public readonly string Name;
        public readonly int Value;
        public Variable(string name, int value) { Name = name; Value = value; }

        public override int Evaluate() { return Value; }
        public override string ToString() { return Name; }
        public override bool NeedsParentheses { get { return false; } }
    }

    class Operator : Expression
    {
        public Expression Operand1;
        public Expression Operand2;
        public string OperatorName;
        public Func<int, int, int> Eval;
        public Operator(Expression op1, Expression op2, string opName, Func<int, int, int> eval)
        {
            Operand1 = op1;
            Operand2 = op2;
            OperatorName = opName;
            Eval = eval;
        }

        public override int Evaluate()
        {
            return Eval(Operand1.Evaluate(), Operand2.Evaluate());
        }

        public override string ToString()
        {
            return string.Format("{0}{1}{2} {6} {3}{4}{5}",
                Operand1.NeedsParentheses ? "(" : "", Operand1, Operand1.NeedsParentheses ? ")" : "",
                Operand2.NeedsParentheses ? "(" : "", Operand2, Operand2.NeedsParentheses ? ")" : "",
                OperatorName);
        }
    }

    class Add : Operator { public Add(Expression op1, Expression op2) : base(op1, op2, "+", (a, b) => a + b) { } }
    class Subtract : Operator { public Subtract(Expression op1, Expression op2) : base(op1, op2, "−", (a, b) => a - b) { } }
    class Multiply : Operator { public Multiply(Expression op1, Expression op2) : base(op1, op2, "×", (a, b) => a * b) { } }

    void Start()
    {
        moduleId = moduleIdCounter++;

        for (var i = 0; i < Buttons.Length; i++)
            Buttons[i].OnInteract += ButtonPressed(i);

        alph = Enumerable.Range(0, 26).Select(ch => (char) (ch + 'A')).ToList().Shuffle();

        for (var i = 0; i < Labels.Length; i++)
            Labels[i].text = alph[i].ToString();

        var sN = BombInfo.GetSerialNumber().Select(ch => ch < 'A' ? int.Parse(ch.ToString()) : ch - 'A' + 1).ToList();

        //Ruleseed start
        var variables = new List<Variable>();

        for (var ltr = 0; ltr < 25; ltr++)
            variables.Add(new Variable(string.Format("A{0}", ltr + 1), alph[ltr] - 'A' + 1));
        for (var repeat = 0; repeat < 3; repeat++)
        {
            variables.Add(new Variable("BH", BombInfo.GetBatteryHolderCount()));
            variables.Add(new Variable("B", BombInfo.GetBatteryCount()));
            variables.Add(new Variable("PP", BombInfo.GetPortPlateCount()));
            variables.Add(new Variable("P", BombInfo.GetPortCount()));
            variables.Add(new Variable("I", BombInfo.GetIndicators().Count()));
            variables.Add(new Variable("UI", BombInfo.GetOffIndicators().Count()));
            variables.Add(new Variable("LI", BombInfo.GetOnIndicators().Count()));
            for (var sn = 0; sn < sN.Count; sn++)
                variables.Add(new Variable(string.Format("S{0}", sn + 1), sN[sn]));
        }

        var rnd = KMRuleSeedable.GetRNG();
        for (var ltr = 0; ltr < 26; ltr++)
        {
            var operatorCountDecider = rnd.NextDouble();
            var operatorCount = operatorCountDecider < .2 ? 0 : operatorCountDecider < .7 ? 1 : 2;

            Expression expr = variables[rnd.Next(0, variables.Count)];
            for (var o = 0; o < operatorCount; o++)
            {
                var otherOperand = rnd.NextDouble() < .3 ? Constant.GetRandom(rnd) : variables[rnd.Next(0, variables.Count)];
                if (rnd.Next(0, 2) != 0)
                {
                    var t = expr;
                    expr = otherOperand;
                    otherOperand = t;
                }
                switch (rnd.Next(0, 3))
                {
                    case 0: expr = new Add(expr, otherOperand); break;
                    case 1: expr = new Subtract(expr, otherOperand); break;
                    case 2: expr = new Multiply(expr, otherOperand); break;
                }
            }

            rules.Add(expr);
        }

        for (var i = 0; i < 26; i++)
        {
            var words = rnd.ShuffleFisherYates(allWords[i].ToArray());
            ruleWords.Add(words.Take(5).ToArray());
        }
        //Ruleseed end

        resultN = Math.Abs(rules[alph.Last() - 'A'].Evaluate()) % 5 + 1;
        resultWord = ruleWords[alph.Last() - 'A'][resultN - 1];

        Debug.LogFormat(@"[The Missing Letter #{0}] Using rule seed: {1}", moduleId, rnd.Seed);
        Debug.LogFormat(@"[The Missing Letter #{0}] Equations are:{1}{2}", moduleId, Environment.NewLine,
            Enumerable.Range(0, 26).Select(rule => string.Format(@"[The Missing Letter #{0}] {1}: {2}", moduleId, (char) ('A' + rule), rules[rule])).Join(Environment.NewLine));
        Debug.LogFormat(@"[The Missing Letter #{0}] The missing letter is {1}", moduleId, alph.Last());
        Debug.LogFormat(@"[The Missing Letter #{0}] Result n = {1}", moduleId, resultN);
        Debug.LogFormat(@"[The Missing Letter #{0}] Word to enter is: ""{1}""", moduleId, resultWord);
    }

    private KMSelectable.OnInteractHandler ButtonPressed(int btn)
    {
        return delegate ()
        {
            if (moduleSolved || resetActive)
                return false;

            if (resultWord[inpCount].Equals(alph[btn]))
                StartCoroutine(MoveButton(btn));
            else
            {
                Debug.LogFormat(@"[The Missing Letter #{0}] Entered: ""{1}"" — strike!", moduleId, resultWord.Substring(0, inpCount) + alph[btn]);
                BombModule.HandleStrike();
                if (inpCount != 0)
                {
                    resetActive = true;
                    StartCoroutine(ResetActivate());
                }
            }
            return false;
        };
    }

    private IEnumerator ResetActivate()
    {
        for (var i = 0; i < wButtons.Count() - 1; i++)
        {
            StartCoroutine(Reset(inpCount));
            inpCount--;
            yield return new WaitForSeconds(.2f);
        }
        yield return StartCoroutine(Reset(inpCount));
        inpCount = 0;
        resetActive = false;
        wButtons.Clear();
    }

    private IEnumerator Reset(int cP)
    {
        var curPos = cP - 1;
        GetComponent<KMSelectable>().Children[wButtons[curPos]] = Buttons[wButtons[curPos]];
        GetComponent<KMSelectable>().UpdateChildren();

        var duration = .2f;
        var elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[wButtons[curPos]].transform.localPosition = Vector3.Lerp(Buttons[wButtons[curPos]].transform.localPosition, new Vector3(Buttons[wButtons[curPos]].transform.localPosition.x, 0.0135f, Buttons[wButtons[curPos]].transform.localPosition.z), elapsed / duration);
        }

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[wButtons[curPos]].transform.localPosition = Vector3.Lerp(Buttons[wButtons[curPos]].transform.localPosition, new Vector3(Buttons[wButtons[curPos]].transform.localPosition.x, 0.005f, Buttons[wButtons[curPos]].transform.localPosition.z), elapsed / duration);
        }

        Buttons[wButtons[curPos]].transform.localPosition = new Vector3(Planes[wButtons[curPos]].transform.localPosition.x, Buttons[wButtons[curPos]].transform.localPosition.y, Planes[wButtons[curPos]].transform.localPosition.z);
        Buttons[wButtons[curPos]].transform.localScale = new Vector3(1.1f, 1.1f, 0.5f);

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[wButtons[curPos]].transform.localPosition = Vector3.Lerp(Buttons[wButtons[curPos]].transform.localPosition, new Vector3(Buttons[wButtons[curPos]].transform.localPosition.x, 0.0135f, Buttons[wButtons[curPos]].transform.localPosition.z), elapsed / duration);
        }

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[wButtons[curPos]].transform.localPosition = Vector3.Lerp(Buttons[wButtons[curPos]].transform.localPosition, new Vector3(Buttons[wButtons[curPos]].transform.localPosition.x, 0.012f, Buttons[wButtons[curPos]].transform.localPosition.z), elapsed / duration);
        }
    }

    private IEnumerator MoveButton(int btn)
    {
        GetComponent<KMSelectable>().Children[btn] = null;
        GetComponent<KMSelectable>().UpdateChildren();
        wButtons.Add(btn);

        var curPos = inpCount;
        inpCount++;

        var duration = .2f;
        var elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[btn].transform.localPosition = Vector3.Lerp(Buttons[btn].transform.localPosition, new Vector3(Buttons[btn].transform.localPosition.x, 0.0135f, Buttons[btn].transform.localPosition.z), elapsed / duration);
        }

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[btn].transform.localPosition = Vector3.Lerp(Buttons[btn].transform.localPosition, new Vector3(Buttons[btn].transform.localPosition.x, 0.005f, Buttons[btn].transform.localPosition.z), elapsed / duration);
        }

        Buttons[btn].transform.localPosition = new Vector3(WordPlanes[curPos].transform.localPosition.x, Buttons[btn].transform.localPosition.y, WordPlanes[curPos].transform.localPosition.z);
        Buttons[btn].transform.localScale = new Vector3(0.7f, 0.7f, 0.4f);

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[btn].transform.localPosition = Vector3.Lerp(Buttons[btn].transform.localPosition, new Vector3(Buttons[btn].transform.localPosition.x, 0.0135f, Buttons[btn].transform.localPosition.z), elapsed / duration);
        }

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            Buttons[btn].transform.localPosition = Vector3.Lerp(Buttons[btn].transform.localPosition, new Vector3(Buttons[btn].transform.localPosition.x, 0.012f, Buttons[btn].transform.localPosition.z), elapsed / duration);
        }
        curPos++;
        if (curPos == resultWord.Length)
        {
            Debug.LogFormat(@"[The Missing Letter #{0}] Module solved.", moduleId);
            BombModule.HandlePass();
            moduleSolved = true;
            var unusedButtons = Buttons.Where(bt => bt.transform.localScale.x > 1f).ToList();
            for (var i = 0; i < unusedButtons.Count(); i++)
                StartCoroutine(CleanUp(unusedButtons, i));
        }
    }

    private IEnumerator CleanUp(List<KMSelectable> unusedButtons, int i)
    {
        var duration = .2f;
        var elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            unusedButtons[i].transform.localPosition = Vector3.Lerp(unusedButtons[i].transform.localPosition, new Vector3(unusedButtons[i].transform.localPosition.x, 0.0135f, unusedButtons[i].transform.localPosition.z), elapsed / duration);
        }

        duration = .2f;
        elapsed = 0f;
        while (elapsed < duration)
        {
            yield return null;
            elapsed += Time.deltaTime;
            unusedButtons[i].transform.localPosition = Vector3.Lerp(unusedButtons[i].transform.localPosition, new Vector3(unusedButtons[i].transform.localPosition.x, 0.005f, unusedButtons[i].transform.localPosition.z), elapsed / duration);
        }
    }

#pragma warning disable 414
    private readonly string TwitchHelpMessage = @"!{0} A1 C3 D5 [Press buttons A1, C3 and D5 where the letter is the column and the digit is the row]";
#pragma warning restore 414
    IEnumerator ProcessTwitchCommand(string command)
    {
        Match m;
        if (moduleSolved)
        {
            yield return "sendtochaterror The module is already solved.";
            yield break;
        }
        else if ((m = Regex.Match(command, @"^\s*([ABCDE12345 ]+)\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant)).Success)
        {
            yield return null;
            var cell = m.Groups[0].Value.Split(' ');
            for (int i = 0; i < cell.Length; i++)
            {
                if (Regex.IsMatch(cell[i], @"^\s*[ABCDE][12345]\s*$", RegexOptions.IgnoreCase | RegexOptions.CultureInvariant))
                    continue;
                else
                {
                    yield return "sendtochaterror Incorrect syntax.";
                    yield break;
                }
            }
            for (int i = 0; i < cell.Length; i++)
            {
                var row = int.Parse(cell[i].Substring(1, 1));
                var col = cell[i].ToUpperInvariant()[0] - 'A' + 1;
                Buttons[5 * col - 1 + row - 5].OnInteract();
                yield return new WaitForSeconds(.05f);
            }
            yield break;
        }
        else
        {
            yield return "sendtochaterror Invalid Command";
            yield break;
        }
    }

    IEnumerator TwitchHandleForcedSolve()
    {
        Debug.LogFormat(@"[The Missing Letter #{0}] Module was force solved by TP", moduleId);

        for (var i = inpCount; i < resultWord.Length; i++)
        {
            Buttons[alph.IndexOf(resultWord[i])].OnInteract();
            yield return new WaitForSeconds(.1f);
        }
    }

